import Agendamientos from "./pages/Agendamientos"; // Asegúrate de importar el componente

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/Dashboard" element={<Dashboard />} />
                <Route path="/Login.js" element={<Login />} />
                <Route path="/agendar" element={<AgendarClase />} />
                <Route path="/clases" element={<VerClases />} />
                <Route path="/agendamientos" element={<Agendamientos />} /> {/* Ruta para Agendamientos */}
            </Routes>
        </Router>
    );
}

export default App;
